description:
This is the 3,000 study questions for the SPHR examination.  It's an ISO file.  Download it then burn it to a CD and run the software from the CD.

Not the best test prep software around,, I use it, but not relying on it.  That's why I don't feel bad about sharing it here, because in my humble opinion, it's not worth the price they're charging--
